import React from "react";
import { bgColor2e } from "../Styles/backGroundColor";
import { centeringX } from "../Styles/TextStyles";

export function SortButton(props){
    return <DefaultButton name={props.text} click={props.click} color={bgColor2e} width={100} height={30} borderRadius="10px" top={props.top} left={props.left} fontSize="20px" add={centeringX}/>
}
